import React from "react";

function Header() {
  const categories = [
    {
      name: "About Me", //this is the name of the link
      label: "About", //this is the label that will be displayed in the navbar
    },
    {
      name: "Portfolio",
      label: "Portfolio",
    },
    {
      name: "Contact",
      label: "Contact",
    },
    {
      name: "Resume",
      label: "Resume",
    },
  ];

  function categorySelected() {
    console.log("category selected");
  }

  return (
    <header>
      <h2>
        <a href="/" className="flex-row flex-wrap">
          <span role="img" aria-label="icon">
            üñ•Ô∏è
          </span>{" "}
          Jordan Hackworth
        </a>
      </h2>
      <nav>
        <ul className="flex-row">
          {categories.map((category) => (
            <li className="mx-1" key={category.name}>
              <span onClick={() => categorySelected(category.name)}>
                {category.name}
              </span>
            </li>
          ))}
        </ul>
      </nav>
    </header>
  );
}

export default Header;
